module.exports = "<!-- Here is where we want to transition from and to Household Summary and Member Detail components -->\r\n<!--\r\n  1) Create portlet for the household profile summary\r\n  2) Foreach houshold member load show their household profile summary information component\r\n    a. Create Portlet for each member\r\n    b. Edit Profile button (in header) will transition slide to household member profile details\r\n-->\r\n<title-bar title='My Business'>\r\n  <span breadcrumbs>\r\n    / Household\r\n  </span>\r\n</title-bar>\r\n<div class=\"container\">\r\n  <mat-tab-group dynamicHeight=\"true\" #tabMain class=\"no-tabs\">\r\n    <mat-tab>\r\n      <ng-template mat-tab-label hidden>\r\n        Summary\r\n      </ng-template>\r\n      <!-- MY HOUSEHOULD PROFILE DETAILS -->\r\n      <div class=\"row\">\r\n        <div class=\"col-12\">\r\n          <household-profile-summary [household]=\"viewModel\" [stateOptions]=\"stateOptions\"\r\n            [languageOptions]=\"languageOptions\" (handleEditHouseholdDetails)=\"handleEditHouseholdDetails($event)\">\r\n          </household-profile-summary>\r\n        </div>\r\n      </div>\r\n      <!-- HOUSEHOLD MEMBER DETAILS -->\r\n      <div class=\"row\" *ngIf=\"viewModel\">\r\n        <div class=\"col-12\">\r\n          <member-summary-container [householdMembers]=\"householdMembers\" [household]=\"viewModel\"\r\n            [relationshipOptions]=\"relationshipOptions\" (EditMemberEvent)=\"OnEditMemberProfile($event)\">\r\n          </member-summary-container>\r\n        </div>\r\n      </div>\r\n      <!--<div class=\"row\" *ngIf=\"viewModel\">\r\n        <div class=\"col-12\">\r\n          <app-housing-choices-summary [household]=\"viewModel\" (handleEditHousingChoices)=\"handleEditHousingChoices($event)\"></app-housing-choices-summary>\r\n        </div>\r\n      </div>-->\r\n    </mat-tab>\r\n    <mat-tab disabled>\r\n      <ng-template mat-tab-label hidden>\r\n        Select a License Type\r\n      </ng-template>\r\n      <!-- <app-member-profile [memberProfile]=\"editMemberProfile\" [selectedStepIndex]=\"selectedEditStepIndex\" (handleGotoHousehold)=\"handleGotoHousehold($event)\" (handleAddIncome)=\"onAddIncome($event)\"></app-member-profile> -->\r\n\r\n      <div class=\"row\">\r\n        <div class=\"col-12\">\r\n          <div class=\"m-portlet\">\r\n            <div class=\"m-portlet__body\">\r\n\r\n              <scroll-stepper #scrollStepper linear>\r\n                <cdk-step [stepControl]=\"businessTypeControl\">\r\n                  <div class=\"row m-20\">\r\n\r\n                    <div class=\"col-12\">\r\n                      <h5 class=\"fw-md\">\r\n                        What type of Business License are you applying for?\r\n                      </h5>\r\n                      <div class=\"form-row\">\r\n                        <div class=\"col-md-6\">\r\n                          <mat-form-field class=\"col-12\">\r\n                            <input type=\"text\" placeholder=\"Select a business type\" [formControl]=\"businessTypeControl\"\r\n                              matInput [matAutocomplete]=\"auto\">\r\n                            <button mat-button *ngIf=\"businessTypeControl.value\" matSuffix mat-icon-button\r\n                              aria-label=\"Clear\" (click)=\"businessTypeControl.setValue('')\">\r\n                              <mat-icon>close</mat-icon>\r\n                            </button>\r\n                          </mat-form-field>\r\n\r\n                          <mat-autocomplete #auto=\"matAutocomplete\" (optionSelected)=\"moveScroll(scrollStepper)\">\r\n                            <mat-option *ngFor=\"let option of filteredBusinessTypes | async\" [value]=\"option\">{{option}}\r\n                            </mat-option>\r\n                          </mat-autocomplete>\r\n\r\n                        </div>\r\n                      </div>\r\n                      <div class=\"row\">\r\n                        <div class=\"col-3\" *ngFor=\"let option of filteredBusinessTypes | async\">\r\n                          <div class=\"p-2 font-primary\" (click)=\"selectType(option, scrollStepper)\">{{option}}</div>\r\n                        </div>\r\n                      </div>\r\n                    </div>\r\n                  </div>\r\n\r\n                </cdk-step>\r\n                <cdk-step>\r\n\r\n                  <div *ngIf=\"businessTypeControl.value == 'Stoop Line Stand'\" class=\"row m-20\">\r\n                    <div class=\"col-12\">\r\n                      <h1 class=\"bg-primary font-white p-15 br-15\"><span>Stoop Line Stand License</span></h1>\r\n                      <h3 class=\"mt-40 pb-10\">Before you Apply:</h3>\r\n                      <ngb-tabset>\r\n                        <ngb-tab title=\"Summary\">\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row\">\r\n                              <div class=\"col-md-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 m-10 br-10 font-white\">\r\n                                  <label class=\"name\">New Application Fees:</label>\r\n                                  <div class=\"value\">$20 - $170 Per Stand</div>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 m-10 br-10 font-white\">\r\n                                  <label class=\"name\">Application Reviewed Within:</label>\r\n                                  <div class=\"value\">2 Weeks</div>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 m-10 br-10 font-white\">\r\n                                  <label class=\"name\">Renewal Fees:</label>\r\n                                  <div class=\"value\">$80 or $160 Per Stand</div>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 m-10 br-10 font-white\">\r\n                                  <label class=\"name\">Renewal Cycle:</label>\r\n                                  <div class=\"value\">2 Years</div>\r\n                                </div>\r\n                              </div>\r\n                            </div>\r\n                            <div class=\"row mt-40\">\r\n                              <div class=\"col-12\">\r\n                                <h5 class=\"fw-lg\">About</h5>\r\n                                <p>A Stoop Line Stand license is required for a business to sell fruits,\r\n                                  vegetables,\r\n                                  soft drinks, flowers, confectionary, cigars, cigarettes, tobacco, or ice cream from a\r\n                                  stand\r\n                                  outside of and directly adjacent to an existing retail establishment.</p>\r\n\r\n                              </div>\r\n                            </div>\r\n                            <div class=\"row mt-10\">\r\n                              <div class=\"col-12\">\r\n                                <h5 class=\"fw-lg\">Important Message about Business Certificate</h5>\r\n                                <p>You must have the applicable Business Certificate based on your business’s\r\n                                  legal\r\n                                  structure. Although DCA does not require submission of your Business Certificate in\r\n                                  order to\r\n                                  process your application, DCA may request this document under section 20-104 of the\r\n                                  New York\r\n                                  City\r\n                                  Administrative Code.\r\n                                </p>\r\n                                <p>\r\n                                  Sole proprietors operating under a name other than your own must have a\r\n                                  Business/Assumed\r\n                                  Name\r\n                                  Certificate.\r\n                                </p>\r\n                                <p>\r\n                                  Partnerships must have a Partnership Certificate and, if applicable, an Assumed Name\r\n                                  Certificate\r\n                                  for your business.\r\n                                </p>\r\n                                <p>\r\n                                  Corporations, Limited Partnerships, Limited Liability Companies, or Limited Liability\r\n                                  Partnerships must register and remain active with the New York State Division of\r\n                                  Corporations.\r\n                                  You can check your status at www.dos.ny.gov/corps.\r\n                                </p>\r\n                              </div>\r\n\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n\r\n                        <ngb-tab title=\"Detailed Fees\">\r\n\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"bg-white br-20\" style=\"margin-top: -20px\">\r\n                              <table class=\"table br-20\">\r\n                                <thead>\r\n                                  <tr class=\"bg-secondary\">\r\n                                    <th>If You File Your Application Between These Dates: </th>\r\n                                    <th>Fruits, vegetables, soft drinks, flowers</th>\r\n                                    <th>Confectionery</th>\r\n                                    <th>Ice Cream</th>\r\n                                  </tr>\r\n                                </thead>\r\n                                <tbody>\r\n                                  <tr>\r\n                                    <td>From April 1 in an even year to September 30 in an even year</td>\r\n                                    <td>Pay <span class=\"font-lg\">$160</span> for a license expiring March 31 of the\r\n                                      next even year. (Valid for at\r\n                                      most\r\n                                      24\r\n                                      months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\"> $80</span> for a license expiring March 31 of the\r\n                                      next even year. (Valid for at\r\n                                      most\r\n                                      24\r\n                                      months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\">$80</span> for a license expiring March 31 of the\r\n                                      next even year. (Valid for at\r\n                                      most\r\n                                      24\r\n                                      months.)</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>From October 1 in an even year to March 31 in an odd year</td>\r\n                                    <td>Pay <span class=\"font-lg\">$120</span> for a license expiring March 31 of the\r\n                                      soonest even year. (Valid for at\r\n                                      most\r\n                                      18 months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\">$60</span> for a license expiring March 31 of the\r\n                                      soonest even year. (Valid for at\r\n                                      most\r\n                                      18 months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\">$60</span> for a license expiring March 31 of the\r\n                                      soonest even year. (Valid for at\r\n                                      most\r\n                                      18 months.)</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>From April 1 in an odd year to September 30 in an odd year</td>\r\n                                    <td>Pay <span class=\"font-lg\">$80</span> for a license expiring March 31 of the\r\n                                      soonest even year. (Valid for at\r\n                                      most\r\n                                      12 months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\">$40</span> for a license expiring March 31 of the\r\n                                      soonest even year. (Valid for at\r\n                                      most\r\n                                      12 months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\">$40</span> for a license expiring March 31 of the\r\n                                      soonest even year. (Valid for at\r\n                                      most\r\n                                      12 months.)</td>\r\n                                  </tr>\r\n                                  <tr>\r\n                                    <td>From October 1 in an odd year to March 31 in an even year</td>\r\n                                    <td>Pay <span class=\"font-lg\">$40</span> for a license expiring March 31 of the\r\n                                      same even year. (Valid for at\r\n                                      most\r\n                                      6\r\n                                      months.) OR Pay <span class=\"font-lg\">$200</span> for a license expiring March 31\r\n                                      of the next even year.\r\n                                      (Valid\r\n                                      for\r\n                                      at most 30 months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\">$20</span> for a license expiring March 31 of the same\r\n                                      even year. (Valid for at\r\n                                      most\r\n                                      6\r\n                                      months.) OR Pay <span class=\"font-lg\">$100</span> for license expiring March 31 of\r\n                                      the next even year.\r\n                                      (Valid\r\n                                      for\r\n                                      at\r\n                                      most 30 months.)</td>\r\n                                    <td>Pay <span class=\"font-lg\">$20</span> for a license expiring March 31 of the same\r\n                                      even year. (Valid for at\r\n                                      most\r\n                                      6\r\n                                      months.) OR Pay <span class=\"font-lg\">$100</span> for a license expiring March 31\r\n                                      of the next even year.\r\n                                      (Valid\r\n                                      for\r\n                                      at most 30 months.)</td>\r\n                                  </tr>\r\n                                </tbody>\r\n                              </table>\r\n                            </div>\r\n\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"License Requirements\">\r\n\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>\r\n                                  Requirements\r\n                                </h4>\r\n                                <ol>\r\n                                  <li>\r\n                                    <h5>Basic License Application</h5>\r\n                                    <ul class=\"mb-15\">\r\n                                      <li>\r\n                                        If your stoop line stands all have the same category of items for sale, you need\r\n                                        to\r\n                                        submit only ONE license application, regardless of their width.\r\n                                      </li>\r\n\r\n                                      <li>\r\n                                        If your stoop line stands vary in the items for sale, you must submit a separate\r\n                                        license\r\n                                        application for EACH differing set of stands. For example, you plan to sell\r\n                                        fruits\r\n                                        from\r\n                                        two stands and confectionery from another stand. You must submit TWO license\r\n                                        applications: #1 (for fruits); #2 (for confectionery). Complete one application\r\n                                        for\r\n                                        set\r\n                                        #1. Complete a separate application for set #2.\r\n                                      </li>\r\n\r\n                                      <li>\r\n                                        Note: If two (2) stoop line stands are separated by a door or other structure,\r\n                                        they\r\n                                        will\r\n                                        be considered two (2) separate stands for licensing purposes.\r\n                                      </li>\r\n\r\n                                    </ul>\r\n\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>Stoop Line Stand Affirmation</h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5><a class=\"m-link font-primary\">Proof of Right to Use Premises (Document)</a>\r\n                                    </h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5><a class=\"m-link font-primary\">Granting Authority to Act Affirmation\r\n                                        (Document)</a>\r\n                                    </h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>License Fee - See Details</h5>\r\n                                  </li>\r\n                                </ol>\r\n\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"Required Documents\">\r\n\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>\r\n                                  Required Documentation\r\n                                </h4>\r\n                                <ol>\r\n                                  <li>\r\n                                    <h5>Proof of Right to Use Premises</h5>\r\n                                    <div>Submit ONE of the following documents as proof of right to use premises where\r\n                                      your\r\n                                      stoop line stand will operate:</div>\r\n                                    <ul class=\"mb-15\">\r\n                                      <li>\r\n                                        A copy of your deed\r\n                                      </li>\r\n\r\n                                      <li>\r\n                                        Bill of sale\r\n                                      </li>\r\n\r\n                                      <li>\r\n                                        <span class=\"font-primary\">Property Owner’s Consent for Stoop Line\r\n                                          Stands.</span>\r\n                                        You must have this form completed by the owner if you do not own the premises\r\n                                        outside of which your stoop line stand will operate.\r\n                                      </li>\r\n\r\n                                    </ul>\r\n\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>Granting Authority to Act Affirmation</h5>\r\n                                    <div>Required if someone other than the license applicant will prepare and submit\r\n                                      this\r\n                                      application. Note: The applicant must sign the license application and all related\r\n                                      forms</div>\r\n                                  </li>\r\n\r\n                                </ol>\r\n\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"After You Apply\">\r\n\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>\r\n                                  After you submit your application\r\n                                </h4>\r\n                                <ol>\r\n                                  <li>\r\n                                    Within two weeks of DCA receiving all required materials, applicants will receive\r\n                                    one of the following notifications by mail with the status of their license\r\n                                    application.\r\n                                    -If the application is approved, DCA will issue the applicant a license document.\r\n                                    -If the application requires additional information, DCA will notify the applicant\r\n                                    by mail with instructions on how to submit this information. If the applicant does\r\n                                    not submit the requested materials to DCA within 10 days of receiving this\r\n                                    notification letter, the application will be denied.\r\n                                    -If the application is denied, DCA will provide an explanation for the denial and\r\n                                    information about the reapplication process.\r\n                                  </li>\r\n                                </ol>\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"Operating and Renewing\">\r\n\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>\r\n                                  Operating Requirements\r\n                                </h4>\r\n                                <ol>\r\n                                  <li>\r\n                                    <h5>Licenses are valid for up to two years and expire on March 31 of years that end\r\n                                      in\r\n                                      an even number.</h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>If any of the information submitted in the approved application changes, the\r\n                                      licensee must inform DCA of those changes by calling 311 or by visiting the DCA\r\n                                      Licensing Center. DCA recommends that licensees call 311 to confirm that they need\r\n                                      to go to the Licensing Center for any specific change.</h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>All laws and rules of the City of New York, including the Consumer Protection\r\n                                      Law\r\n                                      and Rules, are available through the <span class=\"font-primary\">PUBLIC ACCESS\r\n                                        PORTAL</span>. For convenience, sections\r\n                                      of the New York City Licensing Law and Rules are available as a downloadable\r\n                                      handout.\r\n                                      <a href=\"\" class=\"font-primary\">DOWNLOAD LICENSING LAW AND RULES HANDOUT (PDF)</a>\r\n                                    </h5>\r\n                                  </li>\r\n                                </ol>\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                      </ngb-tabset>\r\n                      <div class=\"actions d-flex justify-content-end\">\r\n                        <button class=\"btn btn-primary\" (click)=\"apply()\">Start Application</button>\r\n                      </div>\r\n                    </div>\r\n                  </div>\r\n                  <div *ngIf=\"businessTypeControl.value == 'Sidewalk Café'\" class=\"row m-20\">\r\n                    <div class=\"col-12\">\r\n                      <h1 class=\"bg-primary font-white p-15 br-15\"><span>Sidewalk Café License</span></h1>\r\n                      <h3>Before you Apply:</h3>\r\n                      <ngb-tabset>\r\n                        <ngb-tab title=\"Summary\">\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row\">\r\n                              <div class=\"col-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 br-10 font-white\">\r\n                                  <label class=\"name\">New Application Fees:</label>\r\n                                  <div class=\"value\">Fees Vary</div>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 br-10 font-white\">\r\n                                  <label class=\"name\">Application Reviewed Within:</label>\r\n                                  <div class=\"value\">2 Weeks</div>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 br-10 font-white\">\r\n                                  <label class=\"name\">Renewal Fees:</label>\r\n                                  <div class=\"value\">Fees Vary</div>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-3\">\r\n                                <div class=\"static-info col-12 bg-primary p-10 br-10 font-white\">\r\n                                  <label class=\"name\">Renewal Cycle:</label>\r\n                                  <div class=\"value\">2 Years</div>\r\n                                </div>\r\n                              </div>\r\n                            </div>\r\n                            <div class=\"row m-10 mt-20\">\r\n                              <div class=\"col-12\">\r\n                                <h4>About</h4>\r\n                                <div>A Sidewalk Cafe License and revocable consent are required for a\r\n                                  business\r\n                                  that\r\n                                  operates a portion of a restaurant on a public sidewalk.\r\n\r\n                                  There are three types of sidewalk cafés:\r\n\r\n                                  <ul>\r\n                                    <li><b>Enclosed sidewalk cafe: </b>An enclosed area on the public sidewalk in front\r\n                                      of\r\n                                      the\r\n                                      restaurant\r\n                                      that is constructed predominantly of light materials such as glass, plastic, or\r\n                                      lightweight\r\n                                      metal.</li>\r\n                                    <li><b>Unenclosed sidewalk cafe: </b>An outdoor area on the public sidewalk in front\r\n                                      of the\r\n                                      restaurant\r\n                                      that contains removable tables and chairs.</li>\r\n                                    <li><b>Small unenclosed sidewalk cafe: </b>An unenclosed sidewalk café containing no\r\n                                      more\r\n                                      than a\r\n                                      single\r\n                                      row of tables and chairs next to the building. The tables and chairs can occupy no\r\n                                      more\r\n                                      than 4\r\n                                      feet, 6 inches of the public sidewalk.</li>\r\n                                  </ul>\r\n                                </div>\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"Detailed Fees\">\r\n                          <ng-template ngbTabContent>\r\n\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>Select Cafe Type: </h4>\r\n                                <div class=\"row align-items-center\">\r\n                                  <div class=\"col-8\">\r\n                                    <mat-radio-group [(ngModel)]=\"selectedCafeType\" class=\"d-flex\">\r\n                                      <mat-radio-button class=\"col-xl-4\" [value]=\"true\">\r\n                                        Enclosed Sidewalk Café\r\n                                      </mat-radio-button>\r\n                                      <mat-radio-button class=\"col-xl-8\" [value]=\"false\">\r\n                                        Unenclosed and Small Unenclosed Sidewalk Café\r\n                                      </mat-radio-button>\r\n                                    </mat-radio-group>\r\n                                  </div>\r\n                                  <mat-form-field class=\"col-4\">\r\n                                    <mat-label>Cafe Square Footage</mat-label>\r\n                                    <mat-select [(ngModel)]=\"selectedCafeSize\">\r\n                                      <mat-option *ngFor=\"let space of sidewalkFootage\" [value]=\"space\">\r\n                                        {{space}}\r\n                                      </mat-option>\r\n                                    </mat-select>\r\n                                  </mat-form-field>\r\n                                </div>\r\n                                <ol class=\"m-20\">\r\n                                  <li>Two-year License Fee: <span class=\"fw-xl\">$510</span></li>\r\n                                  <li>Fee for starting, renewing, or assigning DCA consent for all sidewalk café types:\r\n                                    <span class=\"fw-xl\">$445</span> </li>\r\n                                  <li>Consent Fees for {{(selectedCafeType)? 'Enclosed Cafe':'Unenclosed Cafe'}}\r\n                                    sidewalk\r\n                                    space:\r\n                                    <table *ngIf=\"selectedCafeSize\">\r\n                                      <tbody>\r\n                                        <mat-radio-group [(ngModel)]=\"cafeLocation\">\r\n                                          <mat-radio-button class=\"p-20\" [value]=\"'Manhattan'\">\r\n                                            <tr>\r\n                                              <td>Manhattan – Southern tip to 96th Street</td>\r\n                                            </tr>\r\n                                            <tr>\r\n                                              <td [ngClass]=\"{'fw-xl':cafeLocation=='Manhattan'}\">\r\n                                                {{calculateConsentFee(selectedCafeType, selectedCafeSize)[0] | currency}}\r\n                                              </td>\r\n                                            </tr>\r\n                                          </mat-radio-button>\r\n\r\n                                          <mat-radio-button class=\"p-20\" [value]=\"'Boroughs'\">\r\n                                            <tr>\r\n                                              <td>All of Brooklyn, Bronx, Queens, and Staten Island.\r\n                                                Manhattan – North of 96th Street.</td>\r\n                                            </tr>\r\n                                            <tr>\r\n                                              <td [ngClass]=\"{'fw-xl':cafeLocation=='Boroughs'}\">\r\n                                                {{calculateConsentFee(selectedCafeType, selectedCafeSize)[1] | currency}}\r\n                                              </td>\r\n                                            </tr>\r\n\r\n                                          </mat-radio-button>\r\n                                        </mat-radio-group>\r\n                                      </tbody>\r\n                                    </table>\r\n                                    <div class=\"p-20 fw-lg\" *ngIf=\"!selectedCafeSize\">Select Cafe Type and Size to get\r\n                                      Consent Fees</div>\r\n                                  </li>\r\n                                  <li *ngIf=\"selectedCafeType == false\">Security\r\n                                    Deposit for Unenclosed and Small Unenclosed Sidewalk Café Applicants: <span\r\n                                      class=\"fw-xl\">$1,500</span> (certified checks only, made payable to New York City\r\n                                    Comptroller)</li>\r\n                                  <li *ngIf=\"selectedCafeType == false\">Plan\r\n                                    Review Fee for Unenclosed and Small Unenclosed Sidewalk Café Applicants: <span\r\n                                      class=\"fw-xl\">$310</span></li>\r\n                                  <li *ngIf=\"selectedCafeType == true\">Security Deposit for Enclosed\r\n                                    Sidewalk Café Applicants: <span class=\"fw-xl\">$4,000</span> (certified checks only,\r\n                                    made\r\n                                    payable to New York City Comptroller)</li>\r\n                                  <li *ngIf=\"selectedCafeType == true\">City Planning Fee for Enclosed\r\n                                    Sidewalk Café Applicants: <span class=\"fw-xl\">$55 per seat with a $1,360\r\n                                      minimum</span>\r\n                                    (certified checks or money orders only, made payable to City of New York) </li>\r\n                                </ol>\r\n\r\n                                <!-- <div class=\"col-4\"><select class=\"form-control m-10\" [(ngModel)]=\"selectedCafeSize\">\r\n                              <option [value]=\"null\">Select Square Footage</option>\r\n                              <option >{{space}}</option>;\r\n                            </select></div> -->\r\n                                <div class=\"d-flex m-20 justify-content-center\">\r\n                                  <table class=\"col-4\" *ngIf=\"cafeLocation\">\r\n                                    <thead>\r\n                                      <tr>\r\n                                        <td class=\"fw-xl\">Fee Type</td>\r\n                                        <td class=\"fw-xl\">Fee Amount</td>\r\n                                      </tr>\r\n                                    </thead>\r\n                                    <tbody>\r\n                                      <tr>\r\n                                        <td>License Fee (2 year)</td>\r\n                                        <td>$510.00</td>\r\n                                      </tr>\r\n                                      <tr>\r\n                                        <td>Application Fee</td>\r\n                                        <td>$445.00</td>\r\n                                      </tr>\r\n                                      <tr *ngIf=\"cafeLocation\">\r\n                                        <td>Consent Fee</td>\r\n                                        <td>\r\n                                          {{calculateConsentFee(selectedCafeType, selectedCafeSize)[(cafeLocation == 'Manhattan')?0:1] | currency}}\r\n                                        </td>\r\n                                      </tr>\r\n                                      <tr>\r\n                                        <td>Security Deposit</td>\r\n                                        <td>{{(selectedCafeType? 4000:1500) | currency}}</td>\r\n                                      </tr>\r\n                                      <tr>\r\n                                        <td>{{selectedCafeType?'City Planning Fee':'Plan Review Fee'}}</td>\r\n                                        <td>{{(selectedCafeType?1360:310) | currency}}</td>\r\n                                      </tr>\r\n                                      <tr>\r\n                                        <td>Total</td>\r\n                                        <td class=\"fw-xl\">\r\n                                          {{(510 + 445 + calculateConsentFee(selectedCafeType, selectedCafeSize)[(cafeLocation == 'Manhattan')?0:1] + (selectedCafeType? 4000:1500) + (selectedCafeType?1360:310)) | currency}}\r\n                                        </td>\r\n                                      </tr>\r\n                                    </tbody>\r\n                                  </table>\r\n                                </div>\r\n                              </div>\r\n                            </div>\r\n\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"License Requirements\">\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>Before You File Your DCA License Application:</h4>\r\n                                <ol>\r\n                                  <li>\r\n                                    <h5>You must confirm with the Department of City Planning at www.nyc.gov/dcp that\r\n                                      your\r\n                                      proposed sidewalk café meets zoning requirements. DCA cannot accept applications\r\n                                      for a\r\n                                      Sidewalk Café license that do not meet zoning requirements.</h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>You must ensure that the distance from the property line to the curb (i.e.,\r\n                                      sidewalk\r\n                                      space) is at least 12 feet wide for the entire length of the proposed sidewalk\r\n                                      café.\r\n                                      DCA\r\n                                      cannot accept applications for a Sidewalk Café license that do not meet this\r\n                                      requirement.</h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>\r\n                                      You must obtain the following required documents before filing your application.\r\n                                    </h5>\r\n                                    <ul>\r\n                                      <li>\r\n                                        <h5>\r\n                                          Applicable Business Certificates based on your Business's Legal Structure\r\n                                        </h5>\r\n                                        <ul>\r\n                                          <li>\r\n                                            <h6>Sole Proprietorships operating under a name other than your own must\r\n                                              file a\r\n                                              Business/Assumed Name Certificate with the clerk of the county in which\r\n                                              your\r\n                                              business is\r\n                                              conducted.</h6>\r\n                                          </li>\r\n                                          <li>\r\n                                            <h6>Sole Proprietorships doing business under your own name—and not under a\r\n                                              trade\r\n                                              or\r\n                                              Doing-Business-As (DBA) name—do not need a Business Certificate.</h6>\r\n                                          </li>\r\n                                          <li>\r\n                                            <h6>General/Business Partnerships must file your Partnership Certificate\r\n                                              with\r\n                                              the\r\n                                              clerk of the\r\n                                              county in which your business is conducted.</h6>\r\n                                          </li>\r\n                                          <li>\r\n                                            <h6>Corporations, Limited Partnerships, Limited Liability Companies, or\r\n                                              Limited\r\n                                              Liability\r\n                                              Partnerships must register and remain active with the New York State\r\n                                              Department\r\n                                              of State.\r\n                                              Active status will be verified by DCA prior to license issuance. You can\r\n                                              confirm\r\n                                              the\r\n                                              status of your business entity at NYS Web site. If applicable, you must\r\n                                              also\r\n                                              file an\r\n                                              Assumed Name Certificate for your business.</h6>\r\n                                          </li>\r\n                                          <li>\r\n                                            <h6>Businesses incorporated out of state must obtain a Certificate of Doing\r\n                                              Business in Good\r\n                                              Standing from your home state’s Secretary of State and file this with an\r\n                                              application for\r\n                                              Authority to Conduct Business in New York with the New York State\r\n                                              Secretary of\r\n                                              State.</h6>\r\n                                          </li>\r\n                                        </ul>\r\n\r\n\r\n                                      </li>\r\n                                    </ul>\r\n                                  </li>\r\n                                </ol>\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"Required Documents\">\r\n\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>\r\n                                  Required Documentation\r\n                                </h4>\r\n                                <ol>\r\n                                  <li>\r\n                                    <h5>Proof of Right to Use Premises</h5>\r\n                                    <div>Submit ONE of the following documents as proof of right to use premises where\r\n                                      your\r\n                                      sidewalk cafe will operate:</div>\r\n                                    <ul class=\"mb-15\">\r\n                                      <li>\r\n                                        A copy of your deed\r\n                                      </li>\r\n\r\n                                      <li>\r\n                                        Bill of sale\r\n                                      </li>\r\n\r\n                                      <li>\r\n                                        <span class=\"font-primary\">Property Owner’s Consent for Sidewalk Cafe.</span>\r\n                                        You must have this form completed by the owner if you do not own the premises\r\n                                        outside of which your sidewalk cafe will operate.\r\n                                      </li>\r\n\r\n                                    </ul>\r\n\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>Granting Authority to Act Affirmation</h5>\r\n                                    <div>Required if someone other than the license applicant will prepare and submit\r\n                                      this\r\n                                      application. Note: The applicant must sign the license application and all related\r\n                                      forms</div>\r\n                                  </li>\r\n\r\n                                </ol>\r\n\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                        <ngb-tab title=\"Operating & Renewing\">\r\n                          <ng-template ngbTabContent>\r\n                            <div class=\"row m-10\">\r\n                              <div class=\"col-12\">\r\n                                <h4>\r\n                                  Operating Requirements\r\n                                </h4>\r\n                                <ol>\r\n                                  <li>\r\n                                    <h5>\r\n                                      Licenses are valid for up to two years and expire on April 15, May 15, September\r\n                                      15,\r\n                                      or December 15 depending on the last digit of the license number assigned to\r\n                                      business\r\n                                      and the type of sidewalk cafe.\r\n                                    </h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>If any of the information submitted in the approved application changes, the\r\n                                      licensee must inform DCA of those changes by calling 311 or by visiting the DCA\r\n                                      Licensing Center. DCA recommends that licensees call 311 to confirm that they need\r\n                                      to\r\n                                      go to the Licensing Center for any specific change.</h5>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>The licensee must notify DCA within 14 days if their insurance policy is\r\n                                      cancelled,\r\n                                      expired, or was terminated for any reason. Notification must be in writing and\r\n                                      submitted in person OR by mail to the DCA Licensing Center.</h5>\r\n                                    <div class=\"bold pb-20 pl-20\">\r\n                                      <div>\r\n                                        NYC Department of Consumer Affairs (DCA)\r\n                                      </div>\r\n                                      <div>Licensing Center</div>\r\n                                      <div>42 Broadway, Lobby</div>\r\n                                      <div>New York, NY 10004</div>\r\n                                    </div>\r\n                                  </li>\r\n                                  <li>\r\n                                    <h5>All laws and rules of the City of New York, including the Consumer Protection\r\n                                      Law\r\n                                      and Rules, are available through the <span class=\"font-primary\">PUBLIC ACCESS\r\n                                        PORTAL</span>. For convenience, sections of the New York City Licensing Law and\r\n                                      Rules are available as a downloadable handout.\r\n                                      <span class=\"font-primary\">DOWNLOAD LICENSING LAW AND RULES HANDOUT (PDF)</span>\r\n                                    </h5>\r\n                                  </li>\r\n                                </ol>\r\n                              </div>\r\n                            </div>\r\n                          </ng-template>\r\n                        </ngb-tab>\r\n                      </ngb-tabset>\r\n                      <div class=\"actions d-flex justify-content-end\">\r\n                        <button class=\"btn btn-primary\" (click)=\"apply()\">Start Application</button>\r\n                      </div>\r\n                    </div>\r\n                  </div>\r\n                </cdk-step>\r\n              </scroll-stepper>\r\n\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </mat-tab>\r\n    <mat-tab>\r\n      <ng-template mat-tab-label hidden>\r\n        Edit Profile Details\r\n      </ng-template>\r\n\r\n      <app-household-details (handleGotoHousehold)=\"handleGotoHousehold($event)\"\r\n        [selectedStepIndex]=\"selectedHouseholdStepIndex\"></app-household-details>\r\n\r\n    </mat-tab>\r\n    <!--<mat-tab disabled>\r\n      <ng-template mat-tab-label>\r\n        Housing Choices\r\n      </ng-template>\r\n      <app-household-details (handleGotoHousehold)=\"handleGotoHousehold($event)\"></app-household-details>      \r\n      Housing Choices go here\r\n    </mat-tab>-->\r\n\r\n    <mat-tab disabled>\r\n      <ng-template mat-tab-label>\r\n        Edit Student Profile\r\n      </ng-template>\r\n      <app-member-profile [memberProfile]=\"editMemberProfile\" [selectedStepIndex]=\"selectedEditStepIndex\"\r\n        (handleGotoHousehold)=\"handleGotoHousehold($event)\" [selectedLicense]=\"businessTypeControl.value\">\r\n      </app-member-profile>\r\n    </mat-tab>\r\n    <!--<mat-tab disabled>\r\n      <ng-template mat-tab-label>\r\n        Housing Choices\r\n      </ng-template>\r\n      <app-household-details (handleGotoHousehold)=\"handleGotoHousehold($event)\"></app-household-details>      \r\n      Housing Choices go here\r\n    </mat-tab>-->\r\n\r\n  </mat-tab-group>\r\n</div>\r\n\r\n<app-footer *ngIf=\"showAppFooter\"></app-footer>"

